import userListReducer from "../reducer/userList";
import userReducer from "../reducer/OneUser";

import thunk from 'redux-thunk';
import {createStore, applyMiddleware} from "redux";
import {combineReducers} from "redux";

export const userstore = createStore(userReducer, applyMiddleware(thunk));
export const userListstore = createStore(userListReducer, applyMiddleware(thunk));
